import React from 'react';

const CV = () => (
  <section id="cv">
    <h2>Curriculum Vitae</h2>
    <p>Click the link below to download my CV:</p>
    <a href="https://1drv.ms/b/s!AhRkYglczgK8wzYoMDlh3ht6wzqz?e=UMzCef">Download CV</a>
    <h2>Cover Letter</h2>
    <p>Click the link below to download my cover letter:</p>
    <a href="https://1drv.ms/b/s!AhRkYglczgK8w0tDC6ffJdydgSL-?e=evPSuc">Download Cover Letter</a>
  </section>
);

export default CV;
